pragma solidity ^0.8.20;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }

    function _contextSuffixLength() internal view virtual returns (uint256) {
        return 0;
    }
}

abstract contract Ownable is Context {
    address private _owner;
    error OwnableUnauthorizedAccount(address account);
    error OwnableInvalidOwner(address owner);
    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );
    constructor(address initialOwner) {
        if (initialOwner == address(0)) {
            revert OwnableInvalidOwner(address(0));
        }
        _transferOwnership(initialOwner);
    }

    modifier onlyOwner() {
        _checkOwner();
        _;
    }

    function owner() public view virtual returns (address) {
        return _owner;
    }

    function _checkOwner() internal view virtual {
        if (owner() != _msgSender()) {
            revert OwnableUnauthorizedAccount(_msgSender());
        }
    }

    function renounceOwnership() public virtual onlyOwner {
        _transferOwnership(address(0));
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        if (newOwner == address(0)) {
            revert OwnableInvalidOwner(address(0));
        }
        _transferOwnership(newOwner);
    }

    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}
interface IERC20 {
    function transfer(address to, uint256 value) external returns (bool);

    function transferFrom(
        address from,
        address to,
        uint256 value
    ) external returns (bool);
}
interface AggregatorV3Interface {
    function latestRoundData()
        external
        view
        returns (
            uint80 roundId,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
}
contract LilRollsICO is Ownable {
    error NotStarted();
    error AmountNotAvailableForSale();
    error RoundNotMatch();
    error TransferFailed();
    error SCNotAllowed();
    error AlreadyEnabled();
    error Invalid();
    error LengthError();
    error AmountZero();
    error VestingNotEnabled();
    IERC20 private token;
    TokenPriceInUSD private tokenPriceInUSD;
    uint256 private precision = 10000;
    address payable projectWallet;
    uint256 private roundPeriod;
    mapping(address => bool) private isAllowedStableCoin;
    mapping(address => UserInfo) private userInfo;
    RoundTimeInfo private roundTimeInfo;
    RoundHardCapInfo private roundHardCapInfo;
    RoundTokenSaleInfo private roundTokenSaleInfo;
    ICOInfo private icoInfo;
    bool private isICOEnabled;
    bool private isVestingEnabled;
    address[] private teamAndDevMembers;
    uint256 private claimStartedAt;
    uint256 private minimumDelayBetweenClaim;
    mapping(address => uint256) private memberToTotalAmount;
    mapping(address => uint256) private memberToTotalAmountClaimed;
    mapping(address => uint256) private memberLastClaimedAT;
    AggregatorV3Interface priceFeed;

    struct RoundTimeInfo {
        uint256 r1StartTime;
        uint256 r1EndTime;
        uint256 r2StartTime;
        uint256 r2EndTime;
    }

    struct RoundHardCapInfo {
        uint256 r1HardCap;
        uint256 r2HardCap;
    }

    struct RoundTokenSaleInfo {
        uint256 r1SoldToken;
        uint256 r1TokenForSale;
        uint256 r2SoldToken;
        uint256 r2TokenForSale;
    }

    struct UserInfo {
        uint256 r1Purchased;
        uint256 r2Purchased;
        uint256 totalSCInvested;
        uint256 totalBaseInvested;
        uint256 totalPurchased;
    }

    struct ICOInfo {
        uint256 raisedTotalBase;
        uint256 raisedTotalSCToken;
        uint256 soldToken;
    }

    struct TokenPriceInUSD {
        uint256 round1;
        uint256 round2;
    }

    enum PaymentType {
        Base,
        StableCoin
    }

    event TokenPurchased(
        uint256 indexed tokenAmount,
        uint256 indexed amountPaid,
        address purchaser
    );

    constructor(
        address _token,
        address[] memory _allowedStableCoins,
        uint256 _startingTime,
        address payable _pWallet,
        RoundHardCapInfo memory _capInfo,
        TokenPriceInUSD memory _price,
        address _oracle
    ) Ownable(_pWallet) {
        projectWallet = _pWallet;
        roundHardCapInfo = _capInfo;
        roundPeriod = 30 days;
        priceFeed = AggregatorV3Interface(_oracle);
        token = IERC20(_token);
        for (uint256 i = 0; i < _allowedStableCoins.length; i++) {
            isAllowedStableCoin[_allowedStableCoins[i]] = true;
        }
        roundTimeInfo.r1StartTime = _startingTime;
        roundTimeInfo.r1EndTime = (roundTimeInfo.r1StartTime + roundPeriod) - 1;
        roundTimeInfo.r2StartTime = roundTimeInfo.r1EndTime + 1;
        roundTimeInfo.r2EndTime = (roundTimeInfo.r2StartTime + roundPeriod) - 1;

        roundTokenSaleInfo.r1TokenForSale = roundHardCapInfo.r1HardCap;
        roundTokenSaleInfo.r2TokenForSale = roundHardCapInfo.r2HardCap;
        tokenPriceInUSD = _price;
    }

    function updateOracle(address _new) public onlyOwner {
        priceFeed = AggregatorV3Interface(_new);
    }

    function updateToken(address _new) public onlyOwner {
        if (isICOEnabled) {
            revert AlreadyEnabled();
        }
        token = IERC20(_new);
    }

    function addAllowedStableCoin(
        address[] memory _coins,
        bool[] memory _status
    ) public onlyOwner {
        if (_coins.length != _status.length) {
            revert LengthError();
        }
        for (uint256 i = 0; i < _coins.length; i++) {
            isAllowedStableCoin[_coins[i]] = _status[i];
        }
    }

    function enableICO() public onlyOwner {
        if (isICOEnabled) {
            revert AlreadyEnabled();
        }
        isICOEnabled = true;
        uint256 amount = roundHardCapInfo.r1HardCap +
            roundHardCapInfo.r2HardCap;
        token.transferFrom(msg.sender, address(this), amount);
    }

    function updateVestingMode() public onlyOwner {
        isVestingEnabled = !isVestingEnabled;
    }

    function enableVestingForTeamAndDev(
        address[] memory _members,
        uint256[] memory _amounts,
        uint256 _claimStartAt
    ) public onlyOwner {
        if (_members.length != _amounts.length) {
            revert LengthError();
        }
        claimStartedAt = _claimStartAt;
        minimumDelayBetweenClaim = 30 days;
        isVestingEnabled = true;
        uint256 total;
        for (uint256 i = 0; i < _members.length; i++) {
            teamAndDevMembers.push(_members[i]);
            memberToTotalAmount[_members[i]] += _amounts[i];
            total += _amounts[i];
        }
        token.transferFrom(msg.sender, address(this), total);
    }

    function claimToken() public {
        if (!isVestingEnabled) {
            revert VestingNotEnabled();
        }
        if (memberToTotalAmount[msg.sender] <= 0) {
            revert AmountZero();
        }
        uint256 timesCount;
        if (memberLastClaimedAT[msg.sender] <= claimStartedAt) {
            if (block.timestamp > claimStartedAt + minimumDelayBetweenClaim) {
                timesCount =
                    (block.timestamp - claimStartedAt) /
                    minimumDelayBetweenClaim;
            } else {
                timesCount = 1;
            }
            memberLastClaimedAT[msg.sender] = block.timestamp;
        } else if (memberLastClaimedAT[msg.sender] >= claimStartedAt) {
            timesCount =
                (block.timestamp - memberLastClaimedAT[msg.sender]) /
                minimumDelayBetweenClaim;
            memberLastClaimedAT[msg.sender] =
                memberLastClaimedAT[msg.sender] +
                (timesCount * minimumDelayBetweenClaim);
        }
        uint256 amount = memberToTotalAmount[msg.sender] / 24;
        uint256 claimAmount = amount * timesCount;
        if (
            memberToTotalAmountClaimed[msg.sender] + claimAmount >
            memberToTotalAmount[msg.sender]
        ) {
            claimAmount =
                memberToTotalAmount[msg.sender] -
                memberToTotalAmountClaimed[msg.sender];
        }
        if (claimAmount == 0) {
            revert AmountZero();
        }
        memberToTotalAmountClaimed[msg.sender] += claimAmount;
        token.transfer(msg.sender, claimAmount);
    }

    function updateRound1Time(
        uint256 _startTime
    ) public onlyOwner returns (bool) {
        roundTimeInfo.r1StartTime = _startTime;
        roundTimeInfo.r1EndTime = (roundTimeInfo.r1StartTime + roundPeriod) - 1;
        roundTimeInfo.r2StartTime = roundTimeInfo.r1EndTime + 1;
        roundTimeInfo.r2EndTime = (roundTimeInfo.r2StartTime + roundPeriod) - 1;
        return true;
    }

    function updateRound2Time(
        uint256 _startTime
    ) public onlyOwner returns (bool) {
        roundTimeInfo.r1EndTime = block.timestamp;
        roundTimeInfo.r2StartTime = _startTime;
        roundTimeInfo.r2EndTime = (roundTimeInfo.r2StartTime + roundPeriod) - 1;
        return true;
    }

    function updateTokenPrice(
        TokenPriceInUSD memory _price
    ) public onlyOwner returns (bool) {
        tokenPriceInUSD = _price;
        return true;
    }

    function retrieveStuckedAsset(
        address _tokenAddr,
        uint256 _amount,
        address _toWallet,
        bool _base
    ) public onlyOwner returns (bool) {
        IERC20(_tokenAddr).transfer(_toWallet, _amount);
        if (address(this).balance > 0 && _base) {
            (bool success, ) = projectWallet.call{value: address(this).balance}(
                ""
            );
            if (!success) revert TransferFailed();
        }
        return true;
    }

    receive() external payable {
        buy(PaymentType.Base, msg.value, address(0));
    }

    function buy(
        PaymentType _type,
        uint256 _amountToPay,
        address _paymentToken
    ) public payable returns (bool) {
        if (tokenPriceInUSD.round1 == 0) {
            revert NotStarted();
        }
        uint256 currentTime = block.timestamp;
        address currentInvestor = msg.sender;
        uint256 amountToPay;
        UserInfo storage user = userInfo[currentInvestor];
        if (_type == PaymentType.Base) {
            amountToPay = getConversionRate(msg.value);
            (bool success, ) = projectWallet.call{value: msg.value}("");
            if (!success) revert TransferFailed();
            user.totalBaseInvested += msg.value;
            icoInfo.raisedTotalBase += msg.value;
        } else if (_type == PaymentType.StableCoin) {
            amountToPay = _amountToPay;
            if (!isAllowedStableCoin[_paymentToken]) {
                revert SCNotAllowed();
            }
            IERC20(_paymentToken).transferFrom(
                currentInvestor,
                projectWallet,
                amountToPay
            );
            user.totalSCInvested += amountToPay;
            icoInfo.raisedTotalSCToken += amountToPay;
        }

        uint256 amount;

        if (
            currentTime >= roundTimeInfo.r1StartTime &&
            currentTime <= roundTimeInfo.r1EndTime
        ) {
            amount = (amountToPay / tokenPriceInUSD.round1) * precision;
            if (roundTokenSaleInfo.r1TokenForSale < amount) {
                revert AmountNotAvailableForSale();
            }
            roundTokenSaleInfo.r1TokenForSale -= amount;
            roundTokenSaleInfo.r1SoldToken += amount;
            user.r1Purchased += amount;
        } else if (
            currentTime >= roundTimeInfo.r2StartTime &&
            currentTime <= roundTimeInfo.r2EndTime
        ) {
            amount = (amountToPay / tokenPriceInUSD.round2) * precision;
            if (roundTokenSaleInfo.r2TokenForSale < amount) {
                revert AmountNotAvailableForSale();
            }
            roundTokenSaleInfo.r2TokenForSale -= amount;
            roundTokenSaleInfo.r2SoldToken += amount;
            user.r2Purchased += amount;
        } else {
            revert RoundNotMatch();
        }
        if (amount <= 0) {
            revert AmountZero();
        }
        icoInfo.soldToken += amount;
        user.totalPurchased += amount;
        token.transfer(currentInvestor, amount);
        emit TokenPurchased(amount, amountToPay, currentInvestor);
        return true;
    }

    function getConversionRate(
        uint256 bnbAmount
    ) internal view returns (uint256) {
        (, int256 answer, , , ) = priceFeed.latestRoundData();
        uint256 bnbPrice = uint256(answer) * 10000000000;
        uint256 bnbAmountInUsd = (bnbPrice * bnbAmount) / 1000000000000000000;
        return bnbAmountInUsd;
    }

    function round()
        public
        view
        returns (
            string memory _round,
            uint256 endTime,
            uint256 _hardcap,
            uint256 _soldToken,
            uint256 _price
        )
    {
        uint256 currentTime = block.timestamp;
        if (
            currentTime >= roundTimeInfo.r1StartTime &&
            currentTime <= roundTimeInfo.r1EndTime
        ) {
            string memory Round = "PreSale 1";
            return (
                Round,
                roundTimeInfo.r1EndTime,
                roundHardCapInfo.r1HardCap,
                roundTokenSaleInfo.r1SoldToken,
                tokenPriceInUSD.round1
            );
        } else if (
            currentTime >= roundTimeInfo.r2StartTime &&
            currentTime <= roundTimeInfo.r2EndTime
        ) {
            string memory Round = "Public Sale 1";
            return (
                Round,
                roundTimeInfo.r2EndTime,
                roundHardCapInfo.r2HardCap,
                roundTokenSaleInfo.r2SoldToken,
                tokenPriceInUSD.round2
            );
        } else {
            require(false, "Please check ICO time");
        }
    }

    function isRound1Completed() public view returns (bool) {
        if (
            block.timestamp > roundTimeInfo.r1EndTime ||
            roundTokenSaleInfo.r1TokenForSale == 0
        ) {
            return true;
        } else {
            return false;
        }
    }

    function isRound2Completed() public view returns (bool) {
        if (
            block.timestamp > roundTimeInfo.r2EndTime ||
            roundTokenSaleInfo.r2TokenForSale == 0
        ) {
            return true;
        } else {
            return false;
        }
    }

    function getICOInfo() public view returns (ICOInfo memory) {
        return icoInfo;
    }
    function getRoundTimeInfo() public view returns (RoundTimeInfo memory) {
        return roundTimeInfo;
    }
    function getRoundHardCapInfo()
        public
        view
        returns (RoundHardCapInfo memory)
    {
        return roundHardCapInfo;
    }
    function getRoundTokenSaleInfo()
        public
        view
        returns (RoundTokenSaleInfo memory)
    {
        return roundTokenSaleInfo;
    }
    function getUserInfo(address _user) public view returns (UserInfo memory) {
        return userInfo[_user];
    }
    function getTokenPriceInUSD() public view returns (TokenPriceInUSD memory) {
        return tokenPriceInUSD;
    }

    function getIsAllowedStableCoin(address _token) public view returns (bool) {
        return isAllowedStableCoin[_token];
    }

    function getTeamAndDevMembers() public view returns (address[] memory) {
        return teamAndDevMembers;
    }
}
